The first thing you need to do to add the Nicks pallet is to import the pallet-nicks crate in your runtime's Cargo.toml file. If you want a proper primer into Cargo References, you should check out their official documentation . Open substrate-node-template/runtime/Cargo.toml and you will see a list of all the dependencies your runtime has. For example, it depends on the Balances pallet : runtime/Cargo.toml [dependencies]
#--snip--
pallet-balances = { default-features = false, version = '3.0.0' }

